import img_1 from '../Assets/img_1city.jpg'
import img_2 from '../Assets/img_2black-whitecity.jpg'
import img_3 from '../Assets/img_3Big-Man.jpg'
import img_4 from '../Assets/img_4newyork-smokingman.jpg'


let data_product = [
  {
    id: 1,
    name: 'Big colored city',
    image: img_1,
    new_price:400.00,
    old_price:800.00,
  },
  {
    id: 2,
    name: 'A black and white city',
    image: img_2,
    new_price:500.00,
    old_price:800.00,
  },
  {
    id: 3,
    name: 'Punch club man',
    image: img_3,
    new_price:550.00,
    old_price:800.00,
  },
  {
    id: 3,
    name: 'cigarette addict',
    image: img_4,
    new_price:650.00,
    old_price:900.00,
  },
  // Add more image objects as needed
];

export default data_product;
